INSERT INTO `evenements` (`id`, `date`, `heure`, `categorie_id`, `commune_id`, `unite_engagee`, `premiers_elt`, `cro`, `hash`, `sent`, `need_to_send`) VALUES
(1, '2025-05-04', '08:05:04', 316, 9871, '', 'barrières de chantier ont été déplacées et positionnées au milieu d\'une voie, en face du garage -\nun panneau déplacé rue du colombier, vers la vierge ', 'de CD 27 - aucune gène à la circulation, barrières étaient positionnées normalement sur la zone de travaux -', 'd8426a5780dea380417984dabecbfed80d9e5fd1', 0, 1),
(2, '2025-05-04', '08:30:01', 314, 10451, '628 (27) - BTA LES-ANDELYS - 143.101', 'groupe d\'individus en train de camper, font de la tronçonneuse, \nmusique toute la nuit\nzone interdite d\'accès \nen face du Val Saint Martin \nnombre d\'individus indéterminé ', 'Chemin d\'accès à travers champ qui mène à une propriété privée. Nettoyage de la parcelle par le propriétaire et des amis, arrivés la veille.\nA notre arrivée, nettoyage en cours et musique assez forte avec enceinte. Problème de résonance sur l\'autre rive de la Seine. Musique stoppée sur notre demande. Écobuage cessé également. Avons invité les intéressés à prendre une remorque pour les déchets verts en déchetterie et de respecter les horaires des utilisations des débroussailleuses.\nMaire des trois lacs avisé.', '6c7a09d8da82cebe061a44b79f49fab33124ca95', 0, 1),
(3, '2025-05-04', '08:36:35', 310, 21342, '', '05-06 chevaux sur la VP dans les virages dans la partie boisée', '1er adjoint au maire gère la situation', '3f6757319f6fd1006cdc292a8970aa77a29222dd', 0, 1),
(4, '2025-05-04', '08:47:28', 197, 21357, '', 'Fugue d\'un patient très fortement alcoolisé - Il y a moins d\'une heure - Pas de caractère sensible\nTph de la mère : 0232440894', 'aucune personne découverte sur le secteur de BERNAY', 'c4510b94f214165f36bb0c362a5e0f9d67eba6da', 0, 1),
(5, '2025-05-04', '08:55:58', 315, 9994, '', 'Chevreuil blessé dans l\'accotement à gauche en sortant de DAMVILLE - Blessé au train arrière', 'Lieutenant de louveterie se rend sur place', '82986e32cab4021865eee6435b279b050b272bd8', 0, 1),
(6, '2025-05-04', '08:59:54', 346, 10048, '', 'Requérant se trouve à NARBONNE, sa petite amie est partie depuis 1 semaine pour se rendre chez sa mère demeurant BREUILPONT\nA EVREUX aurait vu quelqu\'un qu\'elle connaissait -\nvendredi vers 17h a contacté monsieur par téléphone lui disant que cette connaissance l\'avait tapée, lui avait pris ses affaires, qu\'elle ne pouvait plus partir-\nn\'a plus de nouvelle depuis-\ninjoignable, n\'ouvre pas les messages sur snapchat\n\nRequérant ne connait rien de l\'ndividu - hormis qu\'elle le connaissait à la base - ne lui connait aucun point de chute à EVREUX\nn\'a pas appelé nos services plus tôt mais s\'inquiète aujourd’hui ne ne pas avoir de ses nouvelles \n\nmère habite à BREUILPONT - Natacha ROBIQUET - 0608814211', 'Des éléments recueillis, la JF serait sur EVREUX (déclarations + dernière géolocalisation) -\nToutes les informations ont été transmises à la CIC DDSP EVREUX qui poursuivent les recherches.', 'ceedcb25b12c46e3c06c022a40f18afc5ceecfd3', 0, 1),
(7, '2025-05-04', '09:08:03', 347, 10189, 'BP PONT-AUDEMER - 163.102', 'Découverte d\'un obus, possiblement de mortier, avec une présence d\'ailettes à la base, dans le jardin.\n30-40 cm légèrement évasé à la base', 'Arrivons sur place et prenons attache avec le propriétaire qui nous indique avoir découvert dans son jardin un objet qui pourrait s\'apparenter à un obus. Après constations cela pourrait être exact, néanmoins l\'engin ne semble être constitué que du corps de l\'obus (sans tête). Avons demandé au requérant de le baliser et de ne pas y toucher. Un message ARMO a été réalisé aux fins d\'évacuation de l\'engin. ', '9e9aefadd530d43a10ee5e3c15960935fbb8a70f', 0, 1),
(8, '2025-05-04', '09:19:25', 348, 10456, 'VERNEUIL PAM 1 - 106.102', 'Signale que le voisin a été mordu par son chien - A été pris en charge par les SP - A été évacué vers le CH de VERNEUIL\nChien toujours au domicile - Plus personne sur place\nBlessures importantes à la main et au bras\nDe SAMU : Intervention SP de BOURTH ce jour à 08h20 ', 'Prenons attache avec le propriétaire du chien se trouvant aux urgences de verneuil sur avre, nous déclare s’être fait mordre par son chien à la main, qu\'il ne s\'agit pas de la première fois. Chien est resté au domicile. nous nous rendons ensuite au domicile ou le voisin est présent, nous déclare qu\'il s\'agit d\'une personne ayant un problème avec l\'alcool. l\'invitons à appeler l\'association Brigitte bardot pour relater les faits et voir pour la suite concernant le chien.', '5bdeecd6c1dc867daa52d025923651279eeb021d', 0, 1),
(9, '2025-05-04', '09:27:27', 349, 10213, 'PAM1 BP MONTFORT-SUR-RISLE DIR 3306 - 165.121', 'Frère de la compagne l\'a agressé physiquement à coups de poing au visage - Aurait une batte de baseball dans les mains', 'A notre arrivée sur les lieux, contact prit avec la victime qui nous déclare avoir reçu deux coupsde poing au visage. Aucune trace visible, MEC qui est son beau frère a quitté les lieux avant notre arrivée. La victime ne souhaite pas déposer plainte, renfort pmo bourg Achard. ', 'ade6bb2890b4797e2dcad19a7d8f311ff693ea1e', 0, 1),
(10, '2025-05-04', '09:34:20', 130, 10271, '654 (27) - BP PONT-AUDEMER - 163.101', 'Intervention SP pour personne inconsciente sur VP - Homme 17 ans très fortement alcoolisé - A repris connaissance - Virulent envers les SP', 'ASL, le jeune est pris en charge par les SP PONT AUDMER mais refuse de rentrer avec son beau-père présent sur place. Il sera finalement transporté au CH PONT AUDEMER au vu de son alcoolisation importante. ', '83974842ba27d08fc2240d66fb99f99a8b16ec1c', 0, 1),
(11, '2025-05-04', '09:44:37', 317, 10327, 'PAM 03 BP GISORS - 145.103', 'Requérante signale une effraction au foyer la bonde à saint denis le ferment, avec vol dans un coffre fort', 'Il s\'agit d\'une tentative de vol par effraction où deux individus pénétré dans le bâtiment, forcent la serrure de la porte des bureau. ouvrirons tous les placards et tiroirs. Ils ont ouvert un coffre certainement avec le code de celui-ci car absence de dégradation. Aucun vol constaté mais les agents du foyer vont effectuer un inventaire afin de confirmer ou infirmer un vol. Ils suspect deux jeunes du foyer qui ne reconnaissent pas les faits.\nDirecteur du centre se présentera dans l\'après midi pour déposer plainte.', '3b02c9f401e259fd9524cc2e936e6609d43464c5', 0, 1),
(12, '2025-05-04', '10:20:31', 323, 10234, 'PAM1 AMFREVILLE-ST-AMAND DirLoc 3294 - 125.111', 'Signale que son petit fils est devant chez eux et pète un plomb - Cherche à entrer de force et lance des cailloux dans les vitres - Connu des services pour des violences', 'La grand-mère nous déclare que cela fait des années que son petit fils a des soucis de comportements. Il a été viré de chez ses parents et est venu s\'installer dans le jardin de ses grands parents depuis une semaine. Les grands parents ne veulent plus de lui mais ne ferme pas l\'accès au terrain non plus. Le jeune homme était très calme à notre arrivée dans sa tente. Il déclare que personne ne veut de lui mais ne veut pas travailler pour s\'en sortir. Aujourd\'hui il a réclamer de la nourriture à sa grand-mère qui a refusé de lui donner quoique ce soit. Le petit fils s\'est énervé et a jeté une poignée de petits cailloux sur la maison. Pas de dégradations. \nContact pris avec la mère du jeune homme qui arrive d\'ici quelques heures pour trouver une solution. Le jeune homme lui est parti chez un copain à lui au NEUBOURG pour recharger son téléphone. Reviendra plus tard avec sa mère récupérer ses affaires qui sont restées dans le jardin. \nRequérante invitée à nous rappeler si la situation dégénère à nouveau. ', 'b0ba883dd62317e2a580d90b08873bc2ca79d2c9', 0, 1),
