(14, '2025-05-04', '10:42:13', 319, 21342, 'PAM1 BEAUMONT-LE-ROGER DIR 3302 - 124.121', 'Signale un VL qui bloque le sien - Ne peut pas sortir de son stationnement - A fait le tour des commerce pour essayer de trouver le propriétaire, sans succès\nEst excédé - Est à deux doigts de dégrader le VL concerné', 'ASL, Monsieur est excédé par la situation. Lui proposons de rentrer du côté passager, ce qui est faisable. Aucun dégât sur les VLS et le propriétaire n\'est pas présent. Monsieur finit par écouter nos conseils et quitter son emplacement sans abîmer son véhicule. Situation calme à notre départ.', 'fb8bbc95a04e139916ea66c90643db76f2ad9f49', 0, 1),
