(19, '2025-05-04', '11:43:24', 331, 9993, 'PAM BTA PONT-DE-L-ARCHE DIR 3808 - 156.102', 'clinique de la mare ô dans - clinique psychiatrique \n1 rue forestiere LES DAMPS\npatient alcoolisé vient de repartir en voiture, VL sans permis grise, en mauvais état -\npas de direction de fuite -\npatient hospitalisé à sa demande depuis janvier 2025 - pas de domicile fixe -\npatient prochainement exclu de l\'établissement suite problèmes de comportements - la notification de son exclusion ne lui a pas encore été notifiée en raison de son alcoolisation-\nhier individu retrouvé alcoolisé dans sa voiture sur le parking, clef lui ont été retirées -\nce jour individu était reparti en voiture, est revenu, s\'est disputé à l\'interphone avec une infirmière puis est reparti -\na tenu des propos suicidaires hier, alcoolisé, évoquant des armes à feu dans sa caravane à 30min de là\ncaravane serait chez sa sœur 3 rue saint jean LOUVIERS - coordonnées et identité inconnues - serait en conflit avec sa sœur - la caravane aurait été enlevée', 'de PAM - individu avait regagné l\'établissement lui même - va bien, RAS, pris en charge par les soignantes -', 'a43d5daaaa0e0300975e9fd4ca63bef91580758b', 0, 1),
(20, '2025-05-04', '11:59:41', 309, 9937, 'PR - BTA PACY-SUR-EURE - 155.103, PAM 1 - BTA PACY-SUR-EURE DIRLOC 3290 - 155.101', 'Personne inconsciente au volant de son VL - VL arrêté sur la chaussée', 'PAM Pacy: Le conducteur, circulant en direction de Vernon percute un obstacle et s\'immobilise bien plus tard sur la RN 13 - 27120 Chaignes. Les SP sur place le découvre en bord de chaussée assoupi sur le siège conducteur. A notre ASL, le conducteur est pris en charge dans le véhicule SP, en attente de bilan. De nombreuses canettes d\'alcool et plaquettes de médicaments sont retrouvés dans l\'habitacle. \nSoumis au dépistage, le conducteur titulaire d\'un permis Algérien est négatif Alcoo - positif stupéfiant. Il nous déclare consommé de la cocaïne de manières festives.\nL\'OPJ sur les lieux contacte le NH Navarre, TCI du véhicule qui confirme que le conducteur est un médecin prenant sa garde sur Vernon.\nLe conducteur est évacué sur le CH Vernon pour bilan.\nLe VHL est pris en charge par TOP Garage Pacy/Eure.\nUne procédure est ouverte pour conduite sans permis et sous stupéfiant. ', '4d2427b962789cd19af7cb027d02d7ae625702ac', 0, 1),
