(23, '2025-05-04', '12:17:09', 310, 9948, '', 'chien en divagation, type lévrier \nles champs malade - ', 'M. Le Maire nous explique ne pas avoir découvert de chien. Nous rappelons la requérante qui nous explique avoir retrouvé les propriétaires de l\'animal. ', '242bcd79b4432bf9ce076b12e9de14c06db9d572', 0, 1),
(24, '2025-05-04', '12:28:15', 314, 10456, 'VERNEUIL PAM 1 - 106.102', 'Homme en état d\'ivresse sur la VP - Parait SDF - Est agressif est importune les passants - Parle allemand', 'Prenons attache avec le requérant qui nous explique que l\'individu importuné les clients de sa terrasse. patrouillons sur le secteur, retrouvons l\'individu parlant un peu le français nous explique attendre son train pour Paris, l\'invitons à se déplacer directement à la gare pour attendre son train. RAS à notre départ.  ', '0e4d10a6a3a15f268e11442f7db5aa9b84fe32ee', 0, 1),
(25, '2025-05-04', '12:44:35', 352, 10137, 'PAM BTA LOUVIERS - 153.102', 'Tentative de vol de fret sur un semi transportant des médicaments', 'À notre ASL le chauffeur nous dit être arrivé sur la zone Ecoparc depuis le 03/05, il pense que sa remorque a été fouillée entre 00h00 et 03 heures le 04/05. Aucun vol, nous constatons 2 cartons entre-ouverts. Il s\'agit de cartons de médicaments. Chauffeur invité à déposer plainte ce jour.', '77189a13d49e5975a3ce1dc76e84db449a6cac3d', 0, 1),
(26, '2025-05-04', '13:31:11', 319, 10008, '', 'véhicule  gênant  stationné  en travers le route  -  FOIRE A TOUT  - empeche les gens de partir - \nle requérant se rend au domicile de la propriétaire mais personne ne répond . \n', 'Prenons attache avec le maire qui nous confirme que la voiture a été placée là en vue d\'assurer la sécurité de la FAT - Va prendre attache avec la propriétaire pour la déplacer le temps que le requérante sorte. \nRequérant avisé de la démarche ', '4310757abb277c56b350d258c66dacc266b1bd71', 0, 1),
