(28, '2025-05-04', '14:08:58', 331, 10384, 'PAM1 BP MONTFORT-SUR-RISLE DIR 3306 - 165.121, PAM1 BP ST-GEORGES-DU-VIEVRE - DIR 3808 - 165.102', 'Signale que sa femme est partie à 12h30. L\'homme vit mal la situation. Il nous explique qu\'il va faire une connerie d\'ici une heure... Ne nous précise pas se qu\'il compte faire. \nRequérant M. CAHARD Franck né le 26/06/1973 - \nPrésence de ses 2 filles âgées de 15 et 5 ans /  || Appel de madame qui nous indique être partie pour prendre l\'air - nous communique les coordonnés de sa belle mère Mme CAHARD Réjane qui habite Saint Geroges de Vievre - 0232428322\nAccepte d\'envoyer quelqu\'un pour rendre le téléphone. \nSouhaite que sa belle mère récupère les enfants.  \npas d\'arme au domicile selon la requérante mais élevage de chine présence d\'environ 50 animaux. || Mme CAHARD qui souhaite des renseignement sur l’intervention en cours. ', 'Intervenons au domicile de M. CAHARD a sa demande car son épouse a quitté les lieux et qu\'il est très triste. Arrivé sur place il nous laisse rentrer chez lui et entamons une discussion sans fin. Il présente des périodes de calme et d\'excitation. Prenons attache avec ses parents qui se transportent sur place pour le prendre en charge avec les enfants. Sa femme est retrouvée alcoolisée ++ dans les rues de Montfort. Placement en IPM de cette dernière. ', '3095ace72c643ddf823cdfba7dda500c6941a812', 0, 1),
