(32, '2025-05-04', '15:17:06', 353, 10093, '11150 (27) - PSIG LES-ANDELYS - 142.102, PAM 03 BP GISORS - 145.103, PSIG LES-ANDELYS - DirLoc 3812 - 142.103', '02 Audi  A3 noires et S3  blanche conduisent à vive allure grille les stop .  véhicules avec plaques allemandes ', 'Nous découvrons une des deux voitures signalées stationnée au pied du bâtiment chardonnerais aux bornes de GISORS. Audi RS 3 immatriculée en allemagne GP EY 106. L\'autre véhicule signalé serait déjà partie en direction de la région parisienne. Pas de contravention au code de la route constatée.', 'd84336e694d08ecffed8142ae9aaed593649dc50', 0, 1),
(33, '2025-05-04', '15:27:11', 323, 10141, 'PAM BTA LOUVIERS - 153.102', 'son fils gros consommateur de produits stupéfiants ( cannabis) est en crise  et  violent  - crise survenu car le fils est couché depuis hier et ils ont tenté de le lever \nrequérant âgée de 72 ans - frère présent sur les lieux. \n', 'De PAM : Nous arrivons sur les lieux accompagnés d\'une autre patrouille de la BTA LOUVIERS avec l\'OPJ TC, À notre ASL l\'individu est maintenu au sol par son frère. Ce dernier a retourné sa chambre, cassé les meubles ainsi que d\'autres objets de la maison appartenant à ses parents. Il a également insulté à de nombreuses reprises ses parents.\nL\'origine de la crise fait suite à la fouille de ses affaires par sa mère qui a retrouvé du cannabis alors que ce dernier avait consenti à ne plus fumer. \nL\'individu est connu des services CAC pour dépression et potentiels troubles schizophréniques.\nIl est pris en charge par une ambulance, nous escortons cette dernière jusqu\'aux Urgences d\'Evreux.', '56d222be234d6a55fd38afc46115176064d2b1f7', 0, 1),
(34, '2025-05-04', '16:12:37', 320, 10390, 'PAM 1 - SCENIC CEO - DIR 3812 - 103.102', ' Vélo - contre voiture - cycliste blessé douleur bras et jambe  - \nrequérant témoin 0631963208', 'À notre ASL , les SP sont sur place. Le cycliste présente de légères égratignures. Ne souhaite pas être transporté par les SP. \nLe conducteur du véhicule et le cycliste effectuent un constat à l\'amiable. \nDÉPISTAGES ALCOOLÉMIE  ET STUPÉFIANTS NÉGATIF.', '1f52411696cf4bd36aa0664d38fd57acde89cd61', 0, 1),
(35, '2025-05-04', '16:14:20', 197, 21291, 'PAM1 BEAUMONT-LE-ROGER DIR 3302 - 124.121, PSIG BERNAY DIRLOC 3829 - 122.101', 'fugue d\'un jeune d\'une famille d’accueil - parti y a 5 minutes - car il veut des cigarettes - \nACCUEILLIT DEPUIS SAMEDI 1HRS DU MATIN \nJeune qui arrive de Versailles - pas de point de chute - \na son téléphone 0782602245 - parti en direction de la mairie ', 'Inscription FPR. Pas de photographie pour le moment.', 'c051be07753e286dbe68a705295b5d425c7547e0', 0, 1),
