(38, '2025-05-04', '16:23:46', 323, 10112, 'PAM2 - IVRY LA BATAILLE - DirLoc 815 - 104.102, SCENIC PSIG EVREUX - DirLoc 3798 - 102.101', 'Signale un jeune avec une feuille de boucher - Non menaçant - il s\'amuse à frotter la feuille de boucher sur le sol. Présence de nombreux autre enfants. \nterrain de jeux à coté de la mairie de GUICHAINVILLE\n6 jeunes habillé en noir. \nType africain ', 'Malgré une patrouille sur la commune aucun jeune correspondant au signalement n\'a été découvert', '0111f872b90f01fe1ce6300bbcbdcdca85b2a406', 0, 1),
(39, '2025-05-04', '16:24:38', 327, 21234, 'BP MESNILS-SUR-ITON DIR 3302 - 105.111', 'homme bizarre se baladant possiblement avec un couteau \npersonne âgée cheveux grisonnant habillé avec une veste verte - \nvue par des enfants - ', 'Il s\'agit d\'enfant ayant lancé l\'alerte. un homme de type caucasien vétu d\'une veste verte et un jean bleu, porteur d\'une casquette portant un couteau dans la main les aurai regardé et serai ensuite entré dans un habitation pas un garage. \nAvons effectuer une reconnaissance de la commune, des aires de jeux, et de la maison indiquée par les enfants. aucun individus correspondant à la description découvert.\nRAS', '53072f684dd53655c484349f5e4b615bb1058272', 0, 1),
(40, '2025-05-04', '16:27:08', 331, 9866, 'PAM 1 - SCENIC - BTA VSE - 144.102', 'CODIS 27 - nous signale la tentative de suicide de Mme DIALO Valérie 57 ans. Prise d\'alcool et de médicaments.\nNous expliquons aux pompiers de se rendre sur les lieux et de nous rappeler si besoin s’agissant d\'un intervention médicale. \n17h10 nous rappelons le CODIS qui nous explqiue que Mme DIALO a été retrouvée inconsciente et rapidement transportée au CH en absence de SMUR. \nRequérante initiale des pompiers la fille de Mme DIALO: 06 50 22 93 32. ', 'En nous rendant sur place nous constatons un accident de la route à GASNY retardant notre intervention.\nEn attente de la dépanneuse, nous prenons attache avec la requérante, fille de la personne ayant attenté à se jours et qui se trouve à l\'hôpital.\nSa fille nous explique que sa mère et dépressive depuis de nombreuses années suite à séquelles liées à l\'enfance. En ce moment sa mère traverse des moments difficiles car elle a perdu son emploi et est en cours de séparation depuis le début de l\'année. Sa mère vit depuis janvier au 3 rue du Manoir à BJSO seule depuis la rupture.\nCe jour, en début d\'après midi, elle envoie un message à sa fille, son gendre et sur Facebook disant qu\'elle allait mettre fin à ses jours. Sa fille se rend donc immédiatement à BJSO et découvre sa mère inconsciente au sol et vomissant du sang. La fille nous explique avoir trouvé 3 plaquettes de xanax et une bouteille de vin (75cl) vide. La personne a été transportée inconsciente au CH VERNON. Nous n\'avons pour l\'heure aucun élément sur son état de santé.\nConstatations du domicile effectuées avec le propriétaire.\nCR au GP VEXIN et au magistrat de permanence qui nous demande d\'établir un RJ.', '8c40ac2b829c89a0dd2b35869788947e5ec2d8c6', 0, 1),
(41, '2025-05-04', '16:27:40', 319, 21231, '628 (27) - BTA LES-ANDELYS - 143.101', 'Le requérant nous signale un véhicule qui est stationné sur un passage piéton et qui gène les sorties de VL. \nLe vL est immatriculé AD-987-AS (RAF )', 'À notre arrivé le propriétaire du véhicule se porte à notre niveau. Il explique qu\'il attendait qu\'une place se libère pour bouger son véhicule. \nIl déplace son véhicule sur une place de stationnement prévue a cet effet.\nDépistage réalisés. RAS\nAucune gène.', '43bf5109303f99936d123b3e97619ee441b97c3b', 0, 1),
(42, '2025-05-04', '16:30:50', 310, 21357, '', '2 chiens en liberté - sur le stade de bernay un chien type staffy et noir  et un type labrador  crème - pas de collier pas agressfi ', 'engagement de la fourrière municipale ', '917517bb25ba9028e22f6f36dbe5740cd4be93fe', 0, 1),
(43, '2025-05-04', '16:36:15', 354, 9945, 'PAM2 - IVRY LA BATAILLE - DirLoc 815 - 104.102, SCENIC PSIG EVREUX - DirLoc 3798 - 102.101', 'CODIS 27 - moto cross - douleur dorsal seul en cause. homme de 20 ans \nRequérant pompiers 07 80 18 27 82 ', 'Intéressé a effectué une roue arrière en moto cross et a chuté sur le sol. Transporté au CH EVREUX pour controle. il était équipé d\'un casque, de gants et de chaussures adaptées.', 'b83f260cbd9cbe7e70cd880ef34019e51b25582b', 0, 1),
(44, '2025-05-04', '16:45:23', 314, 10214, '637 (27) - BP BERNAY - 123.104', 'signale que le voisin a frappé son fils  (personne vulnérable)  le voisin a saisit son fils et la projeté au sol . \nsuite à une différent entre enfant dans lequel le fils de la requérante n\'avait rien a voir. \nle voisin habite la rue de derrière . ( les bois de montreuils) ', 'ASL nous rencontrons la mère de l\'enfant vulnérable, elle nous dit que son enfant aurait été poussé par terre par le père d\'un autre enfant qui habite de l\'autre côté de la rue. Madame se rends de suite à l\'hôpital afin d\'avoir un certificat médical concernant les blessures de son enfant ( petite égratignure au genoux ). Prise de contact avec l\'autre partie, le père était déjà a l\'hôpital pour faire constater les blessures de son fils ( nez gonflé, bleu ), l\'enfant vulnérable aurait frappé l\'enfant. Les deux parties se réservent le droit deposer plainte. ', 'bf88964dce799706fb53fb2ef695a0c9fbdcdd5d', 0, 1),
(45, '2025-05-04', '17:24:22', 353, 9898, '', 'bmw - bk-096-jf - voiture conduite dangereuse dépassement par la droite et vitesse excessive  - \r\nA13 apres air eturqueray 132.2 - en direction  - Paris Bleu nuit foncé \r\n a menacé le requérant car ce dernier ne se laissé pas dépassé par la droite', 'véhicule non intercepté', 'f46c58e26730d73c0b5579c4fb26da37a122c9e0', 0, 0),
(46, '2025-05-04', '17:25:37', 354, 10089, 'PAM 1 - SCENIC - BTA VSE - 144.102', 'PAM VEXIN signale un AVP - D1 / D313 -  moto contre 1 VL.', 'Choc avant droit entre le VL arrivant de la D1 et refusant la priorité après arrêt au stop et la moto arrivant de la D313 VERNON. Conducteur moto se plaint de douleur à la cheville et à l\'épaule, transporté CH VERNON par SP VERNON. Dépistages négatifs pour les deux conducteurs. VL et moto enlevés par JDL GISORS', 'f732236a52c438244588b1176cac7d6ae49fce56', 0, 1),
(47, '2025-05-04', '17:28:05', 342, 21231, '628 (27) - BTA LES-ANDELYS - 143.101, BMO LES-ANDELYS - PEUGEOT EXPERT 21620412 - 063.101', 'les tours du levant -- moto cross dans les tours-  bleu sans casque -', 'À notre arrivé sur les lieux, la moto nous fait face à une dizaines de mètres. Il prend la fuite par des espaces verts non roulant pour VL. Reconnaissons formellement le conducteur.\nLa moto est perdu de vue. Nos recherches n’amenè rien de plus.\nProcédure ouverte à notre unité.\nSituation calme à notre départ.', '2b8ee4b8227d141179aa416d84528e9f35ae1cbb', 0, 1),
(48, '2025-05-04', '17:38:42', 131, 39289, 'KODIAK GRD-BOURGTHEROULDE DIR 3318 - 164.111', 'Automobiliste circulant sur l\'A13 en direction de Paris nous signale avoir recu un projectil en passant sous le pont avec le PK 135 en direction PARIS - pare brise fissuré - pas de blessé', 'Avons reconnu l\'axe en question, aucune personne présente ni meme au centre-ville de Routot / Rougemontiers.\nRAS', 'efaf8f6e3f24736e78f074f291543987321c63ec', 0, 1),
(49, '2025-05-04', '17:55:12', 162, 10275, 'PAM BTA PONT-DE-L-ARCHE DIR 3808 - 156.102', 'CIC POLICE 76 nous met en relation avec la requérante. Jeune fille de 15 ans signale avoir été agressé par une autre fille. Non blessé mais souffre à la tête et bras - Auteur est partie en haut de la rue près du camping \nVictime invité à rentrer chez elle et aller consulter un médecin en compagnie de ses parents ', 'sommes rendus au domicile de la victime où nous avons rencontré le père qui n\'était pas au courant que sa fille avait été agressée et cette dernière n\'était pas à la maison . Le père l\'a appelée elle se trouvait chez son petit ami dans une rue adjacente.  Nous y sommes rendus,  la jeune fille nous a dit avoir eu les cheveux et le bras tirés par une adolescente sans plus de précision , il s\'agirait d\'une collégienne de Pont de l\'arche, qui serait encore sur  les rives de l\'Eure à PDL, le père souhaitant porter plainte lui avons demandé de fournir un certificat médical .  Nous  sommes partis à la recherche de la fille sans la trouver, avis au père  qui a été invité à porter plainte et a communiquer le nom de l\'agresseuse. ', '519e1a7719c445dc6c6f172606b7435bb3cf41ee', 0, 1),
(50, '2025-05-04', '18:00:07', 320, 9924, 'PAM1 - PEUGEOT 5008 - 103.101', '1925 - accident  - pietons VL  \nsp avisé par les pam ', 'Accident entre un VL et un piéton.\nLe piéton a été percuté par le rétroviseur du véhicule mis en cause.\nAucune notion de vitesse.\nDépistage ALCO négatif.\nPiéton transporté au CH ÉVREUX pour examen suite à une douleur au niveau de la hanche.\n', '49a4ebe5d0c6511cc09d9737e77cfd342b1a49ff', 0, 1),
(51, '2025-05-04', '18:03:27', 314, 10456, 'VERNEUIL PAM 1 - 106.102', 'Recreation de fiche suite beug logiciel\nindique qu\'ils se sont transportés transporté au domicile de la mère de sa belle fille en vue de récupérer des documents administratifs  lui appartenant  cette dernière est bien présente au domicile mais refuse de lui rendre ', 'ASL : prenons attache avec la requérante, nous explique avoir un différend avec sa mère, qu\'elle lui vole son argent, qu\'elle ne veut pas lui redonner ses affaires, qu\'elle est partie vivre avec son copain sur LIMAY (78). Prenons attache avec sa mère, lui expliquons qu\'elle doit redonner les papiers à sa fille, elle accepte sans difficulté. Un dépôt de plainte a été réalisé au commissariat de mantes la jolie pour l\'argent que sa mère lui volerait. ', 'b4459b9c799270bb217784af706b0c81b4fb1d12', 0, 1),
(52, '2025-05-04', '18:11:07', 312, 10320, 'PAM1 AMFREVILLE-ST-AMAND DirLoc 3294 - 125.111', 'Signale voir son voisin courir dans le jardin. Il est muni d\'un couteau et court après sa fille. \nLe requérant explique que à la fin de l\'appel - l\'homme est dans le jardin et tente de rentrer dans le domicile \nStéphane LEMS et GUYOT Carolan', 'Vérifications au domicile effectuées. La fille et le père vont bien. Ce n\'est pas la première fois que nous intervenons pour les mêmes faits à la même adresse. Avons tenté de rappeler le numéro du requérant mais le numéro n\'est pas attribué. La fille devait changer de ligne téléphonique mais rencontre des difficultés avec son opérateur. Il s\'agit de canulars téléphoniques effectués depuis une autre ligne. Avons vérifié l\'historique d\'appel de la fille, aucun numéro d\'urgence n\'a été composé.\nNous sommes allés voir au numéro 7 rue du lièvre mais ce numéro est inexistant dans la rue. ', 'a90420b0fe0b49da141a2bad1cebe53ea444bada', 0, 1),
(53, '2025-05-04', '18:18:22', 324, 10431, 'KODIAK GRD-BOURGTHEROULDE DIR 3318 - 164.111', 'Requérante signale avoir été menacé par son ex-conjoint lors de l\'échange de garde des enfants en ces termes \" C\'est parce que les enfants sont là sinon je t\'aurais cassé la gueule. Si je te croise je te démonte la gueule, je te bute\" puis lui a crashé au visage. \nEx-compagnon a appris via le biais de son fils qu\'une procédure pour violence sur mineur a été diligenté à son encontre d\'ou ce comportement. \nRequérante veut absolument déposer plainte à la gendarmerie de Grand Bourgtheroulde ou elle a déjà déposé de multiples plaintes pour VIF', 'CRO PREFORMATE : \n\nV (Victime): Identité complète, coordonnées téléphoniques, lien à l\'auteur, profession\n--\n\nI (Intervention/Intervenant): Auteur des faits (identité complète), traces apparentes, coercition ou non\n--\n\nF (Facteurs aggravants): Armes, enfants (nombre, âge), psychotropes (alcool, stupéfiants, médicaments), troubles divers\n--\n\nS (Suites données): judiciaires (interpellé/garde à vue),administratives et/ou médicales (strictement utile à l\'intervention)\n--\n\n || La personne s\'est présentée à l\'unité - elle est invité a déposer plainte lundi après midi - ', 'bd1057e84370cb5d9e2af84cc5cb800ed92c58a8', 0, 1),
(54, '2025-05-04', '18:18:41', 313, 9950, '628 (27) - BTA LES-ANDELYS - 143.101, 633 (27) - BP LYONS-LA-FORET - 146.112, PSIG LES-ANDELYS - DirLoc 3812 - 142.103', 'CODIS 27 - Suite bagarre au stade - SAMU engage un hélicoptère suite personne inconsciente.  ', 'Les pompiers interviennent pour une personne de 75 ans ayant fait un malaise et se plaignant de douleurs thoracique sur le rassemblement NORMANDIE RIDERS qui se tient au stade de CHARLEVAL. L\'hélico du SAMU est demandé par les SP. Ces derniers pour faciliter l\'accès demande à un exposant de déplacer son stand. La famille de la personne trouvant que cela ne va pas assez vite à leur goût commence à déplacer le stand et à invectiver les participants du rassemblement. Des échauffourées ont lieu autour du véhicule des SP qui sollicitent notre intervention. Situation calme à l\'arrivée. La personne de 75 ans est héliporté par le SAMU au CHU ROUEN. Nous invitons la famille à quitter les lieux. Pas de dégradations sur le stand, pas de violence à déplorer. Rassemblement terminé à notre départ. Les organisateurs sont en cours de démontage. PSIG LES ANDELYS sur les lieux. CR GP et Officier Cie LES ANDELYS. Astreinte élu avisé. ', 'cf171b25dddab554d47dfe59ba64f5e6a43448c2', 0, 1),
(55, '2025-05-04', '18:21:30', 320, 10348, '', 'accident sur a 13  CAEN paris- pk 76  pas de blessé -  \n1 seul véhicule immobilisé BAU \n', 'Il s\'agit d\'un accident matériel de la circulation, impliquant un véhicule et 3 personnes à bord. Le conducteur percute la glissière centrale avant de s\'immobiliser dans la glissière de droite.\nPas de blessés.\nLe conducteur nous déclare s\'être endormi.\nDépistages stupéfiants/alcoolémie négatifs.\nLe véhicule ainsi que les trois personnes ont été pris en charge par le dépanneur LOUVIERS DÉPANNAGE.\nAucun gêne à la circulation à notre départ.', '85667bb2823da91ba5d27be694a64a74dbeb97b0', 0, 1),
(56, '2025-05-04', '18:27:06', 314, 10470, 'BP MESNILS-SUR-ITON DIR 3302 - 105.111', 'Signale 5 jeunes qui se devant chez lui et qui cherchent des histoires - Histoires avec les belle fille.', 'Il s\'agit d\'une dispute entre le groupe de 05 jeunes et le beau-père de l\'amie d\'un des 05 jeunes. \nAvons invités les parties à quitter les lieux. Il s\'agissait d\'un désaccord à propos d\'une phot du véhicule des jeunes. \nAucune violences, aucun débordement.', 'c4e1547b271ac90cf76ea2e44e30186c722aff5e', 0, 1),
(57, '2025-05-04', '18:44:14', 314, 10020, 'PAM1  BRIONNE - DirLoc 3290 - 124.101', 'requérant signale que son ex compagne se trouve avec leur deux enfants ( 04 et  07 ans ) en état d\'ivresse au domicile d\'un autre homme - \nlors d\'un 2eme appel indique qu\'une bagarre serait peut etre en cours à cet adresse', 'ASL, 4 individus semblants alcoolisés sont présents dont la mère des enfants avec un discours incohérent. Les deux sœurs de cette dernières sont présentes et ce sont elles qui ont fait appel à nos services car les enfants sont en danger avec elle, elle ne possède plus de logement et consomme de l\'alcool. Le père est alors venu récupérer ses enfants et attend le délibéré du JAF concernant la garde. Les individus ont voulu s\'en prendre à lui et il a quitté les lieux. Aucune violences, les enfants sont en sécurité. Situation calme à notre départ. pris de contact avec le père RAS. ', '6766ef69e41e0c6d8480bf33fbae90d0cfa6a542', 0, 1),
(58, '2025-05-04', '18:47:27', 303, 9987, 'BGE BTA PONT-DE-L-ARCHE DIR 3290 - 156.101', 'les voisins d\'a coté ont mis des jardinières dans la rue alors que c\'est interdit -   - le maire est déjà intervenu et elle sont de nouveau là  . ', 'BGE PDA // Il s’agit d’un différend de voisinage l’un n’est pas content qu’il y ait des jardinières l’autre ayant consulté le cadastre indique être chez lui et faire comme il le veut. Le maire aurait d’ailleurs confirmé qu’il avait le droit. Médiation tentée en mairie', 'd1cc0cbc05af528a8a62fe77a922b2d4908f6214', 0, 1),
(59, '2025-05-04', '18:53:31', 322, 10141, 'PAM BTA LOUVIERS - 153.102', 'Appelant nous signale que ses enfants ont fait la découverte d\'une moto dans un chemin forestier. Ces derniers ont  l\'idée de ramener la moto au domicile. Le père nous signale les faits mais a demandé à ses enfants de ramener la moto sur le lieu de découverte. ', 'À notre ASL le père nous explique que ses enfants ont retrouvé dans la foret une moto et l\'ont ramenée ensuite à la maison. Ce dernier leur a expliqué qu\'il ne fallait pas faire cela, les enfants ont alors ramené la moto là où ils l\'ont trouvée. Le père accompagné de ses deux enfants nous guide alors jusqu\'à la moto.\nLa moto est bien présente en foret, en bordure de chemin forestier.\nLa moto n\'apparait pas volée sur les fichiers et est potentiellement déposée sur une parcelle privée.\nSuites aux directives de l\'OPJ TC nous laissons la moto là où elle a été trouvée et tenterons par la suite d\'en identifier son propriétaire car elle n\'est pas immatriculée.', 'c74807748fb136936cfd693915cca16d610512da', 0, 1),
(60, '2025-05-04', '18:59:31', 349, 10244, 'PAM2 NONANCOURT - DirLoc 3825 - 105.102', 'signale s’être interposé alors qu\'il est en position de repos entre deux automobilistes  suite à  un appel de son épouse. \nN\'a pas été témoin des faits à l\'origine de l\'altercation ', 'Il s\'agit d\'une altercation entre deux automobilistes suite à un comportement dangereux sur la route par le conducteur du VL B. Les deux automobiliste en sont venus au mains.\nDepistages effectués pour les deux conducteur. Présence d\'alcool pour conducteur VL B (verbalisation contraventionnelle)\nLes deux conducteurs sont pris en charge par les proches. Ils ne souhaitent pas être pris en charge par les services des SP.\nLes deux conducteurs sont invités à se présenter dans nos locaux afin de déposer plainte s\'ils le souhaitent dès le lendemain.\nRAs à notre départ.', '06bc361ead6f155aeb4515d9806262673fd1571a', 0, 1),
(61, '2025-05-04', '19:42:29', 326, 10356, 'BP PONT-AUDEMER - 163.102', 'CODIS 27 - feu de haie - pas de risque de propagation mais le requérant était peu précis selon le pompier\nRequérant pompiers: 06 17 31 47 42 - Avons tenter de rentrer en contacta avec le requérant, en vain. ', 'Requérant a fait un barbecue et a jeté les cendres au pied de sa haie. Feu maitrisé et éteint par les pompiers. RAS a notre départ', 'fef1ac35e564e8b0cbe5d396fe52e258974c47d1', 0, 1),
(62, '2025-05-04', '19:43:03', 355, 10234, 'PAM1 AMFREVILLE-ST-AMAND DirLoc 3294 - 125.111', 'Signale que son fils est allé chez les grand-parents avec ses copains - A été agressif et a commis des dégradations sur place - A volé le portable de sa grand-mère (0757455536) - A menacé de mort son grand-père et a quitté les lieux\nA menacé de s\'en prendre à elle à son domicile', 'Sur place, le petit fils n\'était plus présent, il serait parti avec des amis dans une citroen c3 rouge (immatriculation partielle ..-635-VB). Le petit fils a fait une crise et a cassé des pots de fleurs dans le jardin. Il a pris le téléphone de sa grand-mère et est revenu lui lancer par dessus la clôture. Les grands-parents ne souhaitent pas déposer plaintes pour les dégradations. Mère du jeune homme contactée qui ne veut pas prendre en charge son fils et préfère le laisser embêter ses parents qui sont âgés...\nGrands-parents invités a contacter le 15 si le jeune homme refait une crise afin de le faire hospitaliser vu qu\'il a déjà des antécédents psychiatriques. ', 'c4c7a6b8973e2cce3b2d38f388067ec4388b93e2', 0, 1),
(63, '2025-05-04', '19:45:06', 310, 10112, '', 'chien découvert sur la route de couleur gris bleu  - pas de collier ', 'mise en relation avec la 2eme adjointe de la mairie ', '1a7e7014639f343e2741894752cc82eb878d3a92', 0, 1),
(64, '2025-05-04', '19:53:45', 314, 21342, 'PAM2 BEAUMONT-LE-ROGER - 124.122', 'Signale que son beau-fils a tapé son fils de 13 ans Owen BARRETTE et sa fille de 5 ans Laurine BARRETTE. Le couple est en cours de divorce, (monsieur habite chez ses parents) à cause du beau fils, la mère est sur place mais ne veut rien faire. Apparemment le jeune de 13 ans s\'est fait attrapé par le cou, la fille de 5 ans aurait été frappée également par Nolan SELLE. Mère sur place : Shirley BARRETTE 06-32-32-79-20. Le père veut déposer plainte pour les violences commises par le beau-fils. ', 'Le fils de 17 ans, absent, retrouve sa chambre en désordre. Sa demi sieur a jeté des objets par terre et des granulés. Le frère de 17 ans la prend par la main et la met hors de sa chambre. Le demi frère et frère de la petite insulte l\'ado de 17 ans qui le plaque contre le mur en lui disant d\'arrêter de le traiter de bâtard sachant qu\'il n\'a pas de père connu. Pas de trace de violence ni de rougeur. La mère en a marre de cette situation de séparation et dénonce une manipulation de ses enfants sur leur demi frère. Rendez vous JAF dans 10 jours. Situation calme à notre arrivée et départ. ', 'fd18a7a1c1036ec8a5a9d320f53c2e0bbaff9811', 0, 1),
(65, '2025-05-04', '20:32:36', 327, 10461, '628 (27) - BTA LES-ANDELYS - 143.101', 'Signale une personne qui passe au ralenti en trottinette en regardant insistamment l\'habitation - Est passé il y a 05 minutes\nEtait passé pour la première fois vers 14h00 puis trois autres fois dans l\'après-midi\nPropriétaire absent depuis le 01/05/25 et jusqu\'au 10/05/25\nL\'a vu sur les caméra de sont domicile', 'individu simplement à la recherche de son chat, un sacré de birmanie, un chat qui coûte assez cher, perdu depuis hier ', 'b9481e118b40eb44147b2dcab20d368fdc2bf554', 0, 1),
(66, '2025-05-04', '20:35:07', 197, 10097, '', 'Signale la fugue d\'un jeune âgé de  17 ans , dont elle a la garde car placé chez elle - \r\nS\'est aperçue de la fugue du jeune il y a une heure. Certainement dans l\'après midi après le repas du midi -', 'Information communiquée aux pam - \r\nrequérante invitée a se déplacer à la brigade en cas de non retour du mineur demain matin - \r\ncadre ase informée par la requérante', '3c83f2d569bdd8db8cddfca008934f3420c2ca39', 0, 0),
(67, '2025-05-04', '20:38:22', 356, 10262, 'VERNEUIL PAM 1 - 106.102', 'Signale une maison abandonné avec une maison dans la cour - Deux individus sont entrés dans la propriété en escaladant le mur', 'ASL : aucun véhicule et individus à notre arrivée, constatons une maison abandonnée avec le toit qui est tombé à l\'intérieur. patrouillons sur le secteur RAS. ', 'b894b8ff46f45cb0b3ea94c47e0b6177c5f72b36', 0, 1),
(68, '2025-05-04', '20:56:02', 357, 21262, 'PAM BTA LOUVIERS - 153.102, BGE BTA PONT-DE-L-ARCHE DIR 3290 - 156.101', 'Incendie de VL en cours, intentionnel, petite citadine.', 'BGE PDA // À notre arrivée sur les lieux, les pompiers quittent la zone après extinction d’un feu de véhicule. Aucun témoin sur les lieux. Sur place, nous constatons la présence d’une Peugeot 206 complètement calcinée, sans plaques d’immatriculation apparentes. Le véhicule repose sur un chemin en forêt, sans gêner la circulation. Nous tentons sans succès de localiser le numéro de série sur la carcasse, encore chaude et fumante au moment de notre intervention. Véhicule et constatations approfondies seront faites par les pam.\n', 'd885d24c476ed070f4375cc5bea0ad27ba6679d6', 0, 1),
(69, '2025-05-04', '20:58:47', 311, 21313, 'PAM2 BEAUMONT-LE-ROGER - 124.122', 'Nous signale qu\'il était chez sa copine pendant une semaine, il s\'est fait saccager son appartement par ZANETTI Enzo, un de ses potes, avec un dénommé Thibaut BIGAUT. L\'appartement est le domicile de son père ', 'La victime prête son appartement situé au dessus de la mairie de GISAY LA COUDRE  à son fils. Ce dernier s\'est absenté plus d\'une semaine. Le ou les auteurs ont forcé la porte d\'entrée afin de pénétrer dans l\'appartement et de briser une fenêtre et une télévision. Une enceinte (JBL) ainsi qu\'une console de jeu (XBOX ONE S) ont été dérobées. La boîte aux lettre a également été dégradée. Le ou les auteurs semblent s\'être rasés les poils pubiens dans le lavabo de la salle de bain. CR GELAC BERNAY et CCIE. OPJ sur place. 1 prélèvement bio réalisé et saisie de 02 scellés (rasoir et poils). ', '4b75f1cfa1e939cf92fdf3b36914618daf254766', 0, 1),
(70, '2025-05-04', '21:11:13', 313, 10271, 'BP PONT-AUDEMER - 163.102', 'Femme environ 70 ans en ACR sur la VP - SP sur place - SMUR sur place', 'A notre ASL, la victime se trouve en réanimation dans le véhicule des pompiers avec présence d\'un équipage du SMUR. Elle a été transporté rapidement au CH PONT-AUDEMER où elle été déclarée décédée peu après, sans OML. Le service du CH se charge d\'aviser la famille.\nGP avisé', 'f8c1427aaaa3ea9c49809926cd85ab9988598349', 0, 1),
(71, '2025-05-04', '21:12:46', 292, 10433, 'BP PONT-AUDEMER - 163.102', 'son ex conjoint vient de lui déposer les enfants - \nil s\'en est suivi une altercation entre les deux partie et il cherche a entrer en dans le domicile - ', 'A notre ASL, le conjoint de madame discute dehors avec monsieur. Situation calme et réglée entre les parties. Aucune violence. ', 'ab3878a7950b79c3f54a0431dafd5b0c808767d1', 0, 1),
(72, '2025-05-04', '21:16:31', 322, 39289, '', 'CIC POLICE ROUEN, automobiliste sur A13 qui a l\'impression d\'être suivi, la communication coupe', 'Automobiliste était suivi par un autre véhicule qui a fini par quitter l\'axe - Plus rien à signaler', '58debc877f4c9dee3666ee6e41a0f706a8453503', 0, 0),
(73, '2025-05-04', '21:21:42', 341, 10455, 'BP MESNILS-SUR-ITON DIR 3302 - 105.111', 'Signale qu\'elle était malade, elle n\'est pas allée travailler, son collègue de travail est venu chez elle, ils sont allés manger ensemble, ensuite ils sont allés faire un tour en vélo et trottinette. A leur retour la conjointe de son collègue de travail était sur place en train de filmer, elle l\'a attrapé et lui a mis des coups de poings. Violences réciproques, plusieurs mains courantes ont déjà été établies ', 'A notre ASL l\'homme et l\'autre femme ont quittés les lieux.\nMadame BENATTIA Louisa née le 09/05/1991 à Montpellier, résidant 4 clos de la vallée à Les Ventes -27-, joignable au 06.16.28.82.73 nous indique que son ami, monsieur AKHARAZ Brahim est venu lui rendre visite lorsqu\'il a appris qu\'elle était en arrêt maladie. Ils ont passé la journée ensemble. Au cours de la soirée, la future ex-femme (instance de divorce depuis 01 an) de monsieur AKHARAZ, madame AKHARAZ Yousria s\'est présenté devant le domicile de madame BENATTIA est s\'en est pris a elle et monsieur AKHARAM. \nLa requérante est rentré dans son domicile mais madame AKHARAM est venu toquer à la porte. Madame BENATTIA a tenté de se justifier, en vain, madame AKHARAM l\'a attrapé par les cheveux et les deux femmes se sont battues.\nSéparé par monsieur AKHARAM, madame BENATTIA a fait appel à nos service pendant que les deux autres individus ont quittés les lieux.\nMadame BENATTIA ne présente aucune trace de coups apparente. Prise en charge par les SP, elle n\'est pas transporté au CH.\nL\'invitons à consulter un médecin des urgences et à se présenter dès le lendemain afin de recceuillir sa plainte.\nMadame AKHARAM contacté par Tph indique se rendre immédiatement au CIAT Elbeuf pour un dépot de plainte\nMaire de la commune présent sur les lieux car réside dans la rue', 'c735857809182166b1fc268cf6cdcc49a8be51bb', 0, 1),
(74, '2025-05-04', '21:31:02', 197, 10366, '', 'Signale que sa fille de 16 ans est parti avec son petit copain ce matin 11h30 et de donne plus de nouvelle depuis\nDispute hier au soir - N\'a rien dit ce matin avant de partir\nSerait aller chez un copine Naomi à SAINT GEORGES du VIEVRE\nPetit copain vit au domicile depuis 02 mois', 'Prise de contact avec la mineur et son petit ami\nPlainte en cours entre la mineure et sa mère à la COB SAINT GEORGES DU VIEVRE\nEn accord avec les militaires et le père de la mineure, le jeune couple va passer la nuit chez la mère du petit ami\nRequérante recontactée - Prendra attache avec la COB SAINT GEORGES DU VIEVRE demain', '79644577a6038ce75fc903be7ac8abd1e9517850', 0, 1),
(75, '2025-05-04', '21:49:53', 314, 10189, '', 'Requérant signale le comportement violent au téléphone avec son ami homme. Alors que l\'individu parle avec lui concernant l\'achat d\'un VL l\'homme s\'emporte violemment au téléphone contre son ami qui a insulté le requérant. TPH de l\'homme au téléphone : 07-58-71-13-68 monsieur SAKO Boubakar, couple d\'homme en cours de séparation, le plus virulent alcoolisé. Ils habitent au MARAIS VERNIER ', 'réquisition BOUYGUES TÉLÉCOM : ne peut pas nous donner l\'adresse et LYCAMOBILE ne répond pas de nuit, dernière localisation connue : le 04/05/2025 à 22h04 AVENVUE GEORGES BRASSENS ZA 33 PEUJARD', 'a84b90be4d98916f958d878b836a9418c4a409d4', 0, 1),
(76, '2025-05-04', '21:59:20', 309, 21273, 'PAM1 AMFREVILLE-ST-AMAND DirLoc 3294 - 125.111', 'VL au milieu de la chaussée arrêté sans éclairage - Conducteur parait fortement alcoolisé', 'À notre arrivée, nous constatons la présence d\'un véhicule sur le bord de la chaussée en warning. À côté se trouve un homme qui nous déclare avoir crevé avec son véhicule. Nous le soumettons au dépistage de l\'imprégnation alcoolique, affichant un taux inférieur à 0.25/ litre d\'air expiré. Au vu de son état anormal, nous le soumettons au dépistage stupéfiants également qui s\'est avéré négatif. Il nous explique prendre des médicaments contre la dépression depuis quelques années et avoir bu de l\'alcool en même temps. \nVéhicule retiré par garage DOLPIERRE à AMFREVILLE SAINT AMAND, individu ramené à son domicile qui se trouvait être le village à côté. \n', '9d8e343ef0be2702b9ee6fcf3be7525168d90de7', 0, 1);
INSERT INTO `evenements` (`id`, `date`, `heure`, `categorie_id`, `commune_id`, `unite_engagee`, `premiers_elt`, `cro`, `hash`, `sent`, `need_to_send`) VALUES
(77, '2025-05-04', '22:21:56', 315, 10084, 'BGE BTA PONT-DE-L-ARCHE DIR 3290 - 156.101', 'Nous signale un homme en train de battre ses chiens, devant l immeuble les roitelets, un témoin l\'a vu faire. Il a 4 chiens, il est en train d\'en taper, un témoin a récupéré un chien dans sa voiture ', 'Bagarre entre chiens, une des deux personnes a battu les chiens pour les séparer. Victime a refusé de se faire transporter mais veut déposer plainte. Mail sera effectué à la BTA GAILLON ', '6b10e52a9510e73f21a18b0f61e0ce6bef5154fe', 0, 1),
(78, '2025-05-04', '22:33:45', 322, 9908, 'BP PONT-AUDEMER - 163.102', 'Signale deux individus qui se sont garés là, possible repérage RENAULT CLIO 3 blanche AH-556-QM, la plaque ne correspond pas au VL décrit au téléphone ', 'A notre ASL le véhicule était toujours présent, le conducteur a été contrôlé et correspond au titulaire du VL. IL a quitté les lieux sans difficultés à, notre demande sans pour autant avoir une explication claire sur les raisons de sa présence devant l\'habitation. ', '3b9cda07c6d334edfdcb143c187e4e4bf4f35a6b', 0, 1),
(79, '2025-05-04', '22:48:22', 130, 10390, 'PAM 1 - SCENIC CEO - DIR 3812 - 103.102', 'signale un homme ivre sur la route complètement alcoolisé, tombé devant sa résidence sur l\'accotement, ne bouge plus ', 'ASl, individu fortement alcoolisé, pas blessé. Individu remis à un tiers (sa mère). RAS ', '3efe171e7591a0ad41e378891f015cb4c51c7d5e', 0, 1),
(80, '2025-05-04', '23:07:41', 323, 10384, 'PAM1 BP MONTFORT-SUR-RISLE DIR 3306 - 165.121, BP PONT-AUDEMER - 163.102', 'recevons des appels de monsieur CAHARD demandant où se trouve sa femme - \nsa femme se trouve en cellule de dégrisement suite ipm - \nsoupçonnons fortement que monsieur CAHARD est alcoolisé, lors de cet appel il a tient des propos laissant penser qu\'il pourrait intenter un acte d\'auto agression - il dit qu\'il y a des accidents en France, qu\'il va se prendre une cartouche, qu\'on entendra plus parler de lui - ', 'Nous nous transportons au domicile de M. CAHARD. Dans un premier temps il nous refuse l\'accés à sa propriété. Finalement parvenons à le résonner et il accepte d\'ouvrir. Il indique avoir cherché après sa femme toute la soirée, qu\'il ne comprend pas parce qu\'elle ne donne pas de nouvelle et est injoignable. Finissons par lui dire qu\'elle se trouve en IPM suite intervention de fin de journée. Si dans un premier temps il le prend mal, il finit par entendre raison et nous remercie de notre action. Il se trouve avec son fils aîné (majeur) qui l\'a rejoint et qui va passer la nuit avec lui. M. CAHARD fini par se calmer complétement et décide d\'aller se coucher. Situation calme à notre départ. Avons reçu renfort des PAM Pont Audemer et Grand Bourgtheroulde.', 'b90801b658af04b1d5d055c256b5bf9103deffd5', 0, 1),
(81, '2025-05-04', '23:35:35', 321, 10089, 'PAM 1 - SCENIC - BTA VSE - 144.102', '114 : violences verbales et physiques, fils de la dame qui contacte le service par SMS : 06-14-71-27-55 PROVOOST Thierry ', 'CRO PREFORMATE : \n\nV (Victime): Identité complète, coordonnées téléphoniques, lien à l\'auteur, profession\nMARYE Alexandra née le 17/01/1979 à VERNON, 06.15.52.46.38. Concubine de l\'auteur\n\nI (Intervention/Intervenant): Auteur des faits (identité complète), traces apparentes, coercition ou non\nHOCQUET Sébastien né le 11/12/1972 à MANTES LA JOLIE.\n\nF (Facteurs aggravants): Armes, enfants (nombre, âge), psychotropes (alcool, stupéfiants, médicaments), troubles divers\nConsommation d\'alcool de l\'auteur et la victime. Présence de 3 enfants âgés de 19, 17 et 13 ans\n\nS (Suites données): judiciaires (interpellé/garde à vue),administratives et/ou médicales (strictement utile à l\'intervention)\nPlacement en garde à vue de HOCQUET Sébastien suites aux violences exercées sur MARYE Alexandra (gifles).\n\n\n\nV (Victime): Identité complète, coordonnées téléphoniques, lien à l\'auteur, profession\nMARYE Alexandra née le 17/01/1979 à VERNON, tph 0615524638, concubin, a mordu ce dernier\n\nI (Intervention/Intervenant): Auteur des faits (identité complète), traces apparentes, coercition ou non\nHOCQUET Sébastien né le 11/12/1972 à MANTES LA JOLIE, tph 0674645090, a poussé la victime et lui a mis des claques\n\nF (Facteurs aggravants): Armes, enfants (nombre, âge), psychotropes (alcool, stupéfiants, médicaments), troubles divers\n3 enfants présents (19, 17 et 13 ans), 2 parties alcoolisées\n\nS (Suites données): judiciaires (interpellé/garde à vue),administratives et/ou médicales (strictement utile à l\'intervention)\nH.S placé en garde à vue\n\n', 'cf114042a3a231b1e55b7e5722915ac15005548d', 0, 1),
(82, '2025-05-04', '23:45:38', 162, 10093, 'PAM 03 BP GISORS - 145.103', 'Jeune de 22 ans s\'est faite agressée dans GISORS. A déposé un ami suite à une soirée, s\'est fait frappée par deux individus alors qu\'elle se trouvait dans son VL, elle a juste vu les mains de ses deux agresseurs. A pris des coups à la tête, sont repartis en rigolant. Elle se trouve actuellement devant la brigade de GISORS ', 'À notre arrivé devant les locaux de l\'unité, nous ne découvrons pas la victime. après un entretien téléphonique la victime nous informe se trouver à l’hôpital de GIsors aux urgences où nous nous rendons immédiatement. NOus prenons alors attache avec elle physiquement. Elle nous explique avoir fait une soirée sur la commune de Heudidcourt (27) et avoir ramené un jeune à Gisors. Après l\'avoir déposé elle restera stationné quelques instant. Deux individus masculin ouvrions la portière et la tirerons à l\'extérieur pour lui porter plusieurs coups à la tête. À l\'issue de l\'agression elle se rendra à son domicile à Serifontaire (60) et finira par être raccompagné par son père à Gisors. \nElle nous informe que les deux jeunes agresseurs doivent être plutôt jeune au son des rires lorsqu\'ils ont quitté les lieux.\nElle se présentera dans nos locaux le lendemain afin de déposer plainte.\npatrouille effectuée dans le secteurs du lieu de l\'agression et n\'avons découvert aucun individu. ', 'b19b8f1fbdf5c04f9fc037fe02b3940be1d27412', 0, 1),
(83, '2025-05-04', '23:53:42', 358, 9914, 'VERNEUIL PAM 1 - 106.102', 'incendie d\'une maison - \nla grange de cette maison a brûlé lundi dernier -  || 2nd feu de la semaine chez le même requérant ', 'ASL : présence du requérant (voisin de l’habitation en feu) , des pompiers de Verneuil sur avre (27) et de Breteuil (27). habitation complétement calcinée. Habitation à l\'abandon depuis 6-7 ans appartenant à une personne âgée actuellement en EHPAD à Verneuil sur avre (27). Contactons sa fille habitant la même commune qui s\'est déplacée sur place, s\'agit du deuxième incendie en 15 jours, dernièrement une grange sur le même terrain a également brulé. contactons la mairesse de la commune se déplace également sur place. enquête de voisinage réalisée n\'apporte aucune élément. aucune caméra de surveillance. CR GP et CIE. ', 'cd5a934718106a638c41a31946d081e695f044e3', 0, 1),
(84, '2025-05-05', '00:03:31', 359, 21291, '', 'Famille d\'accueil signale le retour au foyer du jeune de 14 ans qui est partis dès son premier jour de placement. Le jeune est impliqué dans un trafic de stupéfiants, ce soir il est partis collecter 12 000 euros environ dans le 78. Il a des preuves dans son téléphone (photos de billets de banque, pain de cannabis, armes) qu\'il a montré à un autre jeune qui est hébergé dans cette famille d\'accueil. Il revient accompagné d\'un éducateur du 78 entre 00h45 et 01h00 du matin ', 'PAMS avisés, famille d\'accueil et jeune seront convoqués, rappel de la famille d\'accueil ', '26711405273acd374465549933f29cec97bd5599', 0, 1),
(85, '2025-05-05', '00:26:55', 323, 10090, '', 'THOMAS Adrien, 20 ans - agressif avec les membres de sa famille - \nil serait alcoolisé et sous stupéfiants - se cogne la tête au sol sur la VP devant la maison - ', 'QUARO effectuée : la situation s\'est calmée - le jeune a été pris en charge - pas de stupéfiants - la famille va le mettre au lit - \nils sont invité a composer le 17 en cas de nouveau trouble - ', 'ed2751b98cd97ef6fa740a2aaf4be1d98fe404a4', 0, 1),
(86, '2025-05-05', '02:16:04', 314, 21357, '', 'Nous signale qu\'elle est en fauteuil roulant, elle se dispute avec son conjoint, lui ne veut pas laisser partir et la menace. Actuellement elle est dans la chambre de sa fille qui n\'est pas présente. Il n\'arrête pas de la provoquer. 06-13-10-27-43 Cédric ALEXANDRE.', 'QUARO effectué auprès de monsieur, rappel de madame. Le couple ne s\'entend plus depuis des semaines, elle prétend qu\'elle n\'a aucune solution de relogement quant à présent. Aucun élément factuel à lui reprocher cette nuit. Le couple se renvoie la balle sur ses responsabilités. Invités à aller se coucher l\'un et l\'autre. Elle est invitée à contacter le 115 pour déclencher un hébergement d\'urgence. Apparemment une de ses amies va visiter un appartement pour elle demain matin. ', 'f8dcdcfe7df8afb1b0001bbeca63206473c0242e', 0, 1),
(87, '2025-05-05', '02:55:03', 317, 10209, 'BGE -  5008 - BTA GAILLON - 154.103', 'A été réveillé par des gens en pleine nuit, ils ont déposé une remorque en plein milieu de leur cour, a mis en fuite 3 individus qui étaient en train de voler des matériaux ', 'A notre ASL, la remorque est en plein milieu de la rue. Un anti-vol se trouvait sur la roue avant droite. Les rampes étaient baissées. Il s\'agit d\'une remorque qui se trouvait derrière une maison en construction. Le voisin a mis en fuite 3 individus qui seraient repartis à bord d\'une Peugeot. Remorque retirée par Top garage. OPJ TC avisé. Situation calme à notre départ.', '79c74e643dffe700ba705d8178f817c1ea80b3b9', 0, 1),
(88, '2025-05-05', '02:57:55', 342, 21313, '', 'RENAULT CLIO BLANCHE et une autre voiture qui font du rodéo depuis 15 minutes dans le village, possible repérage chez un réparateur d\'engins de motoculture. Actuellement ne sont plus sur place. ', 'aucune patrouille en cours, COB avisée par mail ', 'ed54c364d61ce2f42c3416f96573fa10688ba313', 0, 1),
(89, '2025-05-05', '05:00:34', 324, 9858, 'PAM 03 BP GISORS - 145.103', 'se trouve chez son ami - indique avoir reçu un coup au visage - requérante semble alcoolisée - entendons l\'homme lui demander de raccrocher et la communication coupe subitement - ', 'CRO PREFORMATE : \n\nV (Victime): Identité complète, coordonnées téléphoniques, lien à l\'auteur, profession\nBARRAY SYLVIE 06.26.13.59.44 -26 Rue pierre eugene boyer 60590 SERIFONTAINE\n\nI (Intervention/Intervenant): Auteur des faits (identité complète), traces apparentes, coercition ou non\nCLOUET Christian  les landes de bezu - BEZU LA FORET \n\nF (Facteurs aggravants): Armes, enfants (nombre, âge), psychotropes (alcool, stupéfiants, médicaments), troubles divers\nignore\n\nS (Suites données): judiciaires (interpellé/garde à vue),administratives et/ou médicales (strictement utile à l\'intervention)\nGAV du mis en cause\n\n || À notre arrivée sur les lieux nous rencontrons 2 hommes et une femme. Ils s\'agit d\'une soirée entre ami. la victime et le mis en cause ont une relation amoureuse depuis 3 ans. Mme explique que monsieur lui a porté trois coups, version confirmé par le deuxième homme mais non reconnu par le mis en cause. Ils sont tout les trois alcoolisés. LA victime nous explique qu\'elle ne souhaite pas déposer plainte et que de toute façon \" elle s\'en fout\". Nous lui demandons tout de même de se faire visiter par un médecin et de se présenter dans nos locaux. Elle refusera de nous écouter.\nPlacement en garde à vu du mis en cause. Les différentes personnes sont mises à la porte par le propriétaire qui nous accompagnera. ils attendrons et trouverons une solution pour rentrer chez eu avec un taxis. \nCR OPJ et commandement.', 'd911dc9ecb7b738606055d61301455edea29faaa', 0, 1),
(90, '2025-05-05', '05:10:26', 360, 10480, '644 (27) - CGD LOUVIERS - 150.101, CGD LOUVIERS - 150.107, PSIG LES-ANDELYS - 142.105, 11150 (27) - PSIG LES-ANDELYS - 142.102, PSIG LES-ANDELYS - DirLoc 3812 - 142.103, PSIG LOUVIERS - 152.105', 'Interpellation de 4 objectifs sur la commune de VAL DE REUIL - OI en date du 24/04/25 vol aggravé - \nEngagement PAX PSIG LOUVIERS ET LES ANDELYS - ', 'objectifs interpellés', '9af7f0222360a228b12323c5059886fa73ec3e81', 0, 1),
(91, '2025-05-05', '05:24:41', 350, 9994, 'PAM1 NONANCOURT - DirLoc 3318 - 105.101', 'Vol au lycée de CHAMBRAY à Mesnil sur iton VL PEUGEOT PARTNER EK-377-MF - \nPense que son VL est sur BRETEUIL car ses air pods laissés dans la voiture indiquent une tentative de connexion vers 05h10. \nRequérant tourne dans BRETEUIL mais ne couvre pas son vl pour le moment. \nInscription du VL en urgence ', 'MSG VOL VL EN URGENCE EFFECTUÉ', '7b60daf0d89ae3580fb7eafd197b73d276ab4d9e', 0, 1),
(92, '2025-05-05', '05:44:24', 357, 10198, 'BGE -  5008 - BTA GAILLON - 154.103', 'engin de chantier en feu sur un lotissement en construction ', 'Asl. Nous constatons une mini-pelle en feu sur une remorque. Pompiers sur place. Feu maitrisé. Compte rendu par mail à l\'OPJ de permanence. ', '3dc2a2c791b350efa0e7a02de4224d76fec2fc60', 0, 1),
(93, '2025-05-05', '06:16:15', 354, 10443, 'PAM 1 BERNAY DIRLOC 3294 - 123.101', 'AVP  1  VL seul  1  blessé - ', 'ASL, les pompiers sont déjà sur place et prennent en charge la victime pour la transporter au CHU de Bernay pour contrôle. Pas d\'alcoolémie, pas de stupéfiant. Le véhicule a été dépanné par ROYER.', '60481b1f5c05a8d5a0f53f8bc6a508abda83eea3', 0, 1),
(94, '2025-05-05', '06:54:34', 316, 10480, '', 'Arnaud VITRY 0624833375\nA154 Pk2.4 sens Louviers Incarville \nobjet sur voie de gauche, type barre de fer ', 'SAPN engagée', '13c94681e0f1f6b52e88b2cfc585d537c15da95e', 0, 1);
